func minimumBeautifulSubstrings(s string) int {
    isBeautiful := func(num int) bool {
        for num > 0 {
            if num % 5 != 0 {
                return false
            }
            num /= 5
        }
        return true
    }

    dp := make([]int, len(s)+1)
    for i := range dp {
        dp[i] = 1<<31 - 1
    }
    dp[0] = 0

    for i := 0; i < len(s); i++ {
        if s[i] == '0' {
            continue
        }
        num := 0
        for j := i; j < len(s); j++ {
            num = num*2 + int(s[j]-'0')
            if isBeautiful(num) {
                dp[j+1] = min(dp[j+1], dp[i]+1)
            }
        }
    }

    if dp[len(s)] == 1<<31-1 {
        return -1
    }
    return dp[len(s)]
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}
